    0nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2015-12-08T21:04:43.001398",nt"name": "morocco-enterprise-support",nt"isopen":
    false,nt"url": null,nt"notes": " n        The evaluation will measure the
    specific contribution of the training and support program on key business outcomes.
    There have been no rigorous evaluations conducted on similar programs in Morocco.
    Thus, the evaluation will provide critical information to the APP and the Government
    of Morocco regarding the effectiveness of the Enterprise Support Project and ways
    in which it might be improved. The following are the principle research questions
    the evaluation is designed to address:nnDid the Enterprise Support Project contribute
    to an increase in revenues and profits of the participating entrepreneurs?n- Did
    the program improve survival rates of businesses?n- Did the program affect local
    employment?n- Were the benefits generated by the project greater than project costs?nnThe
    impact of the u201cAGR Supportu201d program is measured by the differences between
    the AGRs in the control group and the AGRs in the treatment group for all the variables
    likely to be affected by the treatment. These differences are calculated by ordinary
    least squares regressions including stratum indicators as a control variable if
    the number of observations is sufficient, and - as often as possible - the value
    of the variable of interest at the time of the initial survey. The purpose of these
    control variables is to improve the precision of the estimators of the program's
    effect by reducing the statistical noise due to the intrinsic heterogeneity among
    the set of AGRs.n      ",nt"license_title": "License Not Specified",nt"extras":
